import ExpenseItem from './ExpenseItem';

const Expenses = ({expenses}) => {
  return (
    <div className="expenses">
      <ExpenseItem title={expenses.title} amount={expenses.amount} date={expenses.date} />
    </div>
  )
}

export default Expenses;
